    public static boolean lemonadeChange(int[] bills) {
        boolean ans = true;
        HashMap<Integer,Integer> map = new HashMap<>();
        map.put(5,0);
        map.put(10,0);
        map.put(20,0);

        Arrays.sort(bills);

        for(int i=0;i<bills.length;i++){

            //take from customer and add to your map
            if(map.containsKey(bills[i])){
                int val = map.get(bills[i]);
                map.put(bills[i],val+1);
            }
            //now deal with what to give back
            //if bill[i]==5 //nothing to give back cuz lemonade costs 5 only

            if(bills[i]==10){
                if(map.get(5)>0){//a 5 exists
                    int newFive = map.get(5)-1;
                    map.put(5,newFive);
                }else{
                    ans = false;
                }
            }

            if(bills[i]==20){
                if(map.get(5)>=3){
                    int newFive = map.get(5)-3;
                    map.put(5,newFive);
                }else if(map.get(10)>=1 && map.get(5)>=1){
                    int newFive = map.get(5)-1;
                    map.put(5,newFive);

                    int newTen = map.get(10)-1;
                    map.put(10,newTen);
                }else{
                    ans = false;
                }
            }
        }



        return ans;
    }
